import React from 'react';
//import logo from './logo.svg';
import './App.css';
import LoginMenu from 'components/LoginMenu.js'

function App() {
  return (
    <div className="App">
          <div className="Menubar">
              <LoginMenu />
          </div>
    </div>
  );
}

export default App;

